import React from "react";
import './Navegacion_Nav.css'

class Navegacion_Nav extends React.Component {
    render() {
        return (
            <div>
                <header id="headermenu">
                    <header>
                        <text>FUNDACIÓN MIA CONSTRUYENDO FUTURO - CREAR ESTUDI</text>
                    </header>
                    <input type="date"></input>
                    <footer>
                        <button id="botones" className='btn btn-danger' >Inicio</button>ç
                        <button id="botones" className='btn btn-danger' >Ayuda</button>
                        <button id="botones" className='btn btn-danger' >Administrador</button>
                        <button id="botones" className='btn btn-danger' >Instituciones</button>
                        <button id="botones" className='btn btn-danger' >Estudiantes</button>
                        <button id="botones" className='btn btn-danger' >Reportes</button>
                        <button id="botones" className='btn btn-danger' >Facturaci</button>
                    </footer>
                </header>
            </div>
        )
    }
}
export default Navegacion_Nav;
